import { Component } from 'react';
import { Row, Col } from 'reactstrap';
import { Colonna } from './tavolaGioco';

export class Tavolo extends Component {
	render() {
		return (
			<Row>
				<Col><Colonna /></Col>
				<Col><Colonna /></Col>
				<Col><Colonna /></Col>
				<Col><Colonna /></Col>
				<Col><Colonna /></Col>
				<Col><Colonna /></Col>
			</Row>
		);
	}
}
